,'Préinscription - Bélé I 2016',2,'2016-05-13 09:39:25',NULL,NULL),(582,293,'Transfert',20,'2016-05-13 09:48:22',NULL,NULL),(583,280,'Préinscription - Bélé I 2016',2,'2016-05-13 10:04:53',NULL,NULL),(584,86,'Préinscription - Bélé I 2016',2,'2016-05-13 11:12:27',NULL,NULL),(585,48,'Accep Histoire',5,'2016-05-13 12:58:56','',NULL),(586,24,'Accep Histoire',5,'2016-05-13 13:02:10','Bonjour Paul,\n\nNous avons le plaisir de t\'annoncer que ton background est approuvé! L\'équipe de rédaction tient cependant à te rappeler que les frontières des Grandes Nations sont fermées depuis 752. ll est possible pour ton personnage de revenir  en Bélénos passé cette date, mais pas d\'en ressortir pour aller à Lavakhnir. Nous tenons à te le préciser juste pour que ce que tu racontes en jeu tienne la route avec la ligne du temps bélénoise.\n\nMerci et bon été à Bélénos,\n\nL\'Équipe de rédaction.',NULL),(587,60,'Accep Histoire',5,'2016-05-13 13:31:58','Bonjour Julie,\n\nL\'équipe de rédaction a décidé d\'approuver ton background. Cependant, nous aimerions y voir les correctifs suivant:\n\n1- Il faudrait que tu rajoutes au minimum 4 ans à ton personnage. Plus serait idéal, mais entrer à l\'université à 8 ans est définitivement trop jeune.\n\n2- La fiole de potion de non-sentiment que tu possèdes autour du cou ne peut pas être une vraie potion de non-sentiment, sauf si tu as la recette et les éléments alchimiques pour en fabriquer une en jeu (ou si tu as les chads pour l\'acheter). En effet, le fait de te permettre d\'avoir une fiole de non-sentiment gratuite parce qu\'elle vient de ton BG te donnerait un avantage injuste sur les autres. Ou alors, j\'ai cru comprendre que les mages de ton groupe avait une sorte de collier qui les contrôle. Peut-être parlais-tu de ça? Il ne s\'agit cependant pas d\'une potion de non-sentiment.\n\nMerci et bon été à Bélénos,\n\nL\'équipe de rédaction.',NULL),(589,238,'Accep Histoire',5,'2016-05-13 13:46:34','Bonjour Myryam,\n\nL\'équipe de rédaction a le plaisir de t\'annoncer que ton background est approuvé! Or, un petit correctif doit être apporté à ton BG. En effet, Maëlys n\'a pas pu être une cuisinière au service de Dagoth lui-même. De plus, si Dagoth engageait une nouvelle cuisinière, celle-ci ne serait pas à Boisé-Profond. Or, Maëlys a pu travailler pour Buck à Ké, le Comte de Braise-Ardente, où se trouve Boisé-Profond!\n\nBon été à Bélénos,\n\nL\'équipe de rédaction.',NULL),(590,282,'Accep Histoire',5,'2016-05-13 13:48:46','',NULL),(591,96,'Accep Histoire',5,'2016-05-13 13:49:12','',NULL),(592,275,'Accep Histoire',5,'2016-05-13 13:51:37','',NULL),(593,164,'Accep Histoire',5,'2016-05-13 13:54:08','',NULL),(594,319,'Accep Histoire',5,'2016-05-13 13:55:07','\nMalheureusement ton personnage ne peut pas provenir d\'Eseldorf. Il s\'agit d\'une provenance à accès restreint et ton background ne correspond pas à quelqu\'un qui provient d\'Eseldorf.\n\nTu peux le soumettre à nouveau, une fois corrigé. ',NULL),(595,241,'Préinscription - Bélé I 2016',2,'2016-05-13 13:57:12',NULL,NULL),(596,52,'Accep Histoire',5,'2016-05-13 14:00:34','Bonjour Sebastien,\n\nSuite aux modifications apportées à ton background, nous avons le plaisir de t\'annoncer que celui-ci est accepté!\n\nBon été à Bélénos,\n\nL\'équipe de rédaction.',NULL),(597,153,'Accep Histoire',5,'2016-05-13 14:01:59','',NULL),(599,388,'Accep Histoire',5,'2016-05-13 14:07:56','Bon background approuvé. Cependant une mini-correction, en Confédération Urdienne, la monnaie utilisé n\'est pas le Chad (monnaie Bélénoise), il s\'agit propablement de monnaie impériale ou dorgonaise, quoique chaque Cité là-bas frappe peut-être sa propre monnaie. Bref, ce n\'est pas défini, donc tu peux dire accumuler de l\'argent. C\'est très mineur comme correction.',NULL),(600,445,'Préinscription - Bélé I 2016',2,'2016-05-13 14:08:21',NULL,NULL),(602,443,'Préinscription - Bélé I 2016',2,'2016-05-13 14:21:54',NULL,NULL),(603,448,'Préinscription - Bélé I 2016',2,'2016-05-13 14:29:55',NULL,NULL),(604,229,'Accep Histoire',5,'2016-05-13 14:39:21','Bon background! Il serait utile que tu ajoute la provenance de ton personnage, royaume de Dagoth ou Royaume d\'Aurélius?',NULL),(606,298,'Accep Histoire',5,'2016-05-13 15:18:24','',NULL),(607,396,'Transfert',27,'2016-05-13 15:20:49',NULL,NULL),(608,396,'Achat - Magie cléricale II',-23,'2016-05-13 15:21:07',NULL,NULL),(609,396,'Achat - Recueillement',-8,'2016-05-13 15:21:10',NULL,NULL),(610,318,'Accep Histoire',5,'2016-05-13 15:21:34','',NULL),(611,154,'Accep Histoire',5,'2016-05-13 15:23:55','',NULL),(613,221,'Préinscription - Bélé I 2016',2,'2016-05-13 15:35:28',NULL,NULL),(614,320,'Préinscription - Bélé I 2016',2,'2016-05-13 15:44:03',NULL,NULL),(615,452,'Préinscription - Bélé I 2016',2,'2016-05-13 16:54:27',NULL,NULL),(616,325,'Préinscription - Bélé I 2016',2,'2016-05-13 17:42:19',NULL,NULL),(617,46,'Préinscription - Bélé I 2016',2,'2016-05-13 17:50:39',NULL,NULL),(618,104,'Transfert',20,'2016-05-13 18:41:11',NULL,NULL),(619,238,'Transfert',20,'2016-05-13 18:41:50',NULL,NULL),(620,67,'Transfert',12,'2016-05-13 18:46:35',NULL,NULL),(621,238,'Achat - Magie cléricale II',-19,'2016-05-13 18:48:13',NULL,NULL),(622,104,'Achat - Magie cléricale II',-19,'2016-05-13 19:05:44',NULL,NULL),(623,122,'Préinscription - Bélé I 2016',2,'2016-05-13 19:41:38',NULL,NULL),(624,122,'Transfert',17,'2016-05-13 20:02:11',NULL,NULL),(625,122,'Achat - Magie cléricale II',-19,'2016-05-13 20:02:30',NULL,NULL),(627,461,'Préinscription - Bélé I 2016',2,'2016-05-13 20:43:51',NULL,NULL),(628,310,'Préinscription - Bélé I 2016',2,'2016-05-13 21:30:59',NULL,NULL),(629,277,'Achat - Recueillement',-8,'2016-05-13 22:10:05',NULL,NULL),(630,464,'Transfert',40,'2016-05-14 00:11:25',NULL,NULL),(631,464,'Achat - Connaissance de la langue arcanique',-25,'2016-05-14 00:14:00',NULL,NULL),(632,464,'Achat - 1er point de vie',-10,'2016-05-14 00:14:21',NULL,NULL),(633,464,'Préinscription - Bélé I 2016',2,'2016-05-14 00:14:43',NULL,NULL),(634,424,'Préinscription - Bélé I 2016',2,'2016-05-14 04:14:36',NULL,NULL),(635,279,'Niveau annulé',0,'2016-05-14 05:55:04',NULL,NULL),(636,67,'Accep Histoire',5,'2016-05-14 06:25:40','',NULL),(637,175,'Accep Histoire',5,'2016-05-14 06:31:14','Bon background vraiment bien fait. Par contre, nous essayons de limiter les contacts/liens que pouvait avoir nos anciens personnages sur nos nouveaux personnages post-reset 2015. Fait attention de pas trop en parler en-jeu ou même si tu veux, modifie le dans ton BG pour pas qu\'on puisse faire un lien.',NULL),(638,444,'Préinscription - Bélé I 2016',2,'2016-05-14 06:43:36',NULL,NULL),(639,194,'Accep Histoire',5,'2016-05-14 06:49:03','Le background est bon, mais on doit tenter de limiter les liens/contacts que nos nouveaux personnages post-reset 2015 ont avec nos anciens personnages pré-reset. Ainsi, évitez de parler en jeu de vos anciens personnages/groupes. ',NULL),(640,178,'Accep Histoire',5,'2016-05-14 06:56:30','Le background est bon, mais il faut faire attention de limiter les liens/contacts que pourraient avoir les nouveaux personnages post-reset 2015 avec ceux avant le reset. Si tu peux évitez de le mentionner en jeu, ou de manière limité, ce serait bien.',NULL),(641,388,'Transfert',50,'2016-05-14 06:57:32',NULL,NULL),(642,388,'Achat - Armure efficace II',-47,'2016-05-14 06:57:46',NULL,NULL),(643,388,'Achat - 1er point de vie',-8,'2016-05-14 06:57:54',NULL,NULL),(644,255,'Accep Histoire',5,'2016-05-14 06:59:01','Une petite correction doit s\'appliquer impérativement. La Forêt Noire ne comporte aucune créature dangereuse, comme les orcs ou les gobelins. Toutefois, il est possible qu\'il y est des loup-garous ou même des elfes féroces qui s\'attaquent à ceux qui y pénètrent.\n\nSinon, bon background!',NULL),(645,205,'Accep Histoire',5,'2016-05-14 07:01:15','Bon backgrond bien ettoffé. ',NULL),(646,68,'Accep Histoire',5,'2016-05-14 07:10:24','Bon background bien etoffé. ',NULL),(647,71,'Accep Histoire',5,'2016-05-14 07:14:47','Les alignements n\'existent plus à Bélénos.\n\nIl est important que le background se situe entre 300 et 500 mots, puisqu\'il s\'agit d\'un résumé de l\'histoire de ton personnage. Tu as à peu près 3000 mots de trop. Ton histoire n\'est pas mauvaise pour autant et tu peux en parler en jeu et la raconter sans qu\'elle soit toute écrite dans ton BG. ',NULL),(648,308,'Accep Histoire',5,'2016-05-14 07:15:50','Bon background. Il est un peu court par contre.',NULL),(649,291,'Accep Histoire',5,'2016-05-14 07:17:36','Bon background, mais un peu trop court. ',NULL),(650,56,'Accep Histoire',5,'2016-05-14 07:18:28','Bon background, un peu court par contre.',NULL),(651,51,'Accep Histoire',5,'2016-05-14 07:24:27','',NULL),(652,67,'Achat - Magie cléricale II',-19,'2016-05-14 07:29:20',NULL,NULL),(653,73,'Accep Histoire',5,'2016-05-14 07:30:48','',NULL),(654,338,'Accep Histoire',5,'2016-05-14 07:31:04','',NULL),(655,344,'Accep Histoire',5,'2016-05-14 07:32:03','',NULL),(656,132,'Accep Histoire',5,'2016-05-14 07:33:01','Bon background, mais il faut faire attention que les nouveaux personnages post-reset 2015 n\'aient pas de liens/contacts avec les anciens personnages pré-reset.',NULL),(657,358,'Accep Histoire',5,'2016-05-14 07:36:03','',NULL),(658,364,'Accep Histoire',5,'2016-05-14 07:36:27','',NULL),(659,369,'Accep Histoire',5,'2016-05-14 07:37:01','',NULL),(660,242,'Accep Histoire',5,'2016-05-14 07:37:16','',NULL),(661,249,'Accep Histoire',5,'2016-05-14 07:39:00','Tu dois absolument rayer le mot viol de ton background. Le viol n\'existe pas dans l\'histoire de bélénos, d\'aucune manière possible. Je te suggère de le remplacer par battu à mort.\n\nLe reste est très bien.',NULL),(662,281,'Accep Histoire',5,'2016-05-14 07:42:25','Bon background. Es-tu albinos dans la vraie vie?\n\nSi la réponse est non, fait très attention à ce que ton déguisement ne fasse pas penser aux cheveux blancs des mangas/cosplay.  ',NULL),(663,395,'Accep Histoire',5,'2016-05-14 07:42:54','',NULL),(664,394,'Accep Histoire',5,'20