t il aurait dû être refusé. \n\nCorrige les fautes que tu peux et remplace toutes les contractions par des mots complets.',NULL),(773,104,'Accep Histoire',5,'2016-05-15 06:06:31','Peux-tu développer un peu qu\'est-ce que Chad vient faire dans le pays bélénois?',NULL),(774,465,'Accep Histoire',5,'2016-05-15 06:07:26','',NULL),(775,445,'Accep Histoire',5,'2016-05-15 06:07:48','',NULL),(776,432,'Accep Histoire',5,'2016-05-15 06:08:19','',NULL),(777,434,'Accep Histoire',5,'2016-05-15 06:08:44','',NULL),(778,233,'Accep Histoire',5,'2016-05-15 06:09:46','Petite correction, la Fosse est dans les terres bélénoise, puisque Bélénos est un pays. Tu voulais sûrement dire vers Hyden?',NULL),(779,277,'Accep Histoire',5,'2016-05-15 06:10:20','',NULL),(780,177,'Accep Histoire',5,'2016-05-15 06:10:58','',NULL),(781,335,'Accep Histoire',5,'2016-05-15 06:11:36','',NULL),(782,498,'Accep Histoire',5,'2016-05-15 06:13:03','',NULL),(783,482,'Accep Histoire',5,'2016-05-15 06:16:44','Figwitt est un nom de personnage que nous avons refusé malheureusement, corrige le dans ton BG avec le nouveau nom que le joueur aura choisi pour son personnage.  Sinon, ton background est bien!',NULL),(784,487,'Accep Histoire',5,'2016-05-15 06:18:20','Bon background, mais ton orc ne doit pas avoir réellement massacré un géant des steppes. C\'est beaucoup trop rare. Cela dit, ce pouvait être un très grand homme et ton orc peut être persuadé d\'avoir tué un geant des steppes. ',NULL),(785,506,'Accep Histoire',5,'2016-05-15 06:27:02','',NULL),(786,510,'Préinscription - Bélé I 2016',2,'2016-05-15 07:02:01',NULL,NULL),(787,511,'Préinscription - Bélé I 2016',2,'2016-05-15 07:06:38',NULL,NULL),(788,481,'Accep Histoire',5,'2016-05-15 07:09:44','',NULL),(791,495,'Préinscription - Bélé I 2016',2,'2016-05-15 09:57:27',NULL,NULL),(792,495,'Achat - 1er point de vie',-5,'2016-05-15 09:59:29',NULL,NULL),(793,514,'Préinscription - Bélé I 2016',2,'2016-05-15 10:00:26',NULL,NULL),(794,515,'Préinscription - Bélé I 2016',2,'2016-05-15 10:08:12',NULL,NULL),(795,516,'Préinscription - Bélé I 2016',2,'2016-05-15 10:12:38',NULL,NULL),(796,502,'Préinscription - Bélé I 2016',2,'2016-05-15 10:49:16',NULL,NULL),(797,513,'Préinscription - Bélé I 2016',2,'2016-05-15 10:58:12',NULL,NULL),(798,517,'Préinscription - Bélé I 2016',2,'2016-05-15 11:05:34',NULL,NULL),(799,293,'Accep Histoire',5,'2016-05-15 11:19:11','',NULL),(800,222,'Accep Histoire',5,'2016-05-15 11:29:05','L\'histoire est bonne. Cependant, l\'histoire sur les zombies doit etre revu un peu, il est possible qu\'un nécromancien ait attaqué un village e tout. Cependant, les esprits ne peuvent pas t\'avoir vraiment communiqué ça de cette façon, ce serait l\'habileté spéciale parler aux esprits.  Tu dois corriger ça.\n\nJe te suggère que tu aie trouver un cadavre d\'un ancien zombie qui t\'appelait et que tu ailles communiquer avec lui (parler aux morts) et lui pourrait te raconter ton histoire avec le nécromant.',NULL),(801,473,'Préinscription - Bélé I 2016',2,'2016-05-15 11:35:31',NULL,NULL),(802,99,'Accep Histoire',5,'2016-05-15 11:40:24','Le domaine Chateauvieu est déjà dans les terres de Belenos. Donc la fin de ton BG devrait être : \nElle décida donc de suivre sa soeur pour aller à Hyden. \nBelenos est un pays, séparé en deux royaumes, Aurélius et Dagoth. Le domaine Chateauvieu est dans le nord du Royaume d\'Aurélius, tandis qu\'Hyden est dans le Royaume de Dagoth. Dans l\'espoir de t\'avoir éclairé.',NULL),(803,72,'Accep Histoire',5,'2016-05-15 11:41:09','',NULL),(804,355,'Accep Histoire',5,'2016-05-15 11:45:32','La griffe de l\'ouest est maintenant nommé Taurë Ilfirin. ',NULL),(805,342,'Accep Histoire',5,'2016-05-15 11:48:27','Le background est bon, mais les orcs dans notre univers ne sont pas idiots, même que certains sont lettrés. Cela dit, ton orc a toi peut être particulièrement stupide ou illettré, comme ce pourrait être le cas avec un humain. ',NULL),(806,321,'Accep Histoire',5,'2016-05-15 11:50:11','Nous allons accepté ton background vu la proximité de la date limite, mais ton personnage ne peut pas provenir d\'Eseldorf, pas dans ces conditions, normalement nous l\'aurions refusé. \nChange absolument ce détail de ton histoire. ',NULL),(807,156,'Accep Histoire',5,'2016-05-15 11:56:58','Le background est bon, cependant il faut faire attention de limité les contacts/liens que nos anciens personnages pré-reset avec les nouveaux personnages. \n\nLe Duché de Volg n\'est pas dans le Royaume Bélénois. Le Duché d\'Hyden n\'existe pas, il s\'agit de la baronnie d\'Hyden. De petits détails géographiques. ',NULL),(808,385,'Accep Histoire',5,'2016-05-15 12:00:17','Le background est bon. Cependant, Figwit a été un nom refusé, remplace le par le nouveau nom que le joueur aura choisi. ',NULL),(809,513,'Accep Histoire',5,'2016-05-15 12:07:06','Le BG est correct.\n\nNous mettons un bémol, peu importe le background, ce n\'est jamais une justification pour tuer sans raison des personnages. On doit eviter de tuer des personnages sans raison et sans scène de jeu intéressante, cela peut valoir un avertissement ou même un blâme. ',NULL),(810,518,'Préinscription - Bélé I 2016',2,'2016-05-15 12:07:59',NULL,NULL),(812,520,'Préinscription - Bélé I 2016',2,'2016-05-15 12:44:18',NULL,NULL),(813,522,'Préinscription - Bélé I 2016',2,'2016-05-15 13:39:40',NULL,NULL),(814,524,'Préinscription - Bélé I 2016',2,'2016-05-15 14:08:26',NULL,NULL),(815,502,'Accep Histoire',5,'2016-05-15 14:23:00','',NULL),(816,194,'Achat - 1er point de vie',-5,'2016-05-15 14:23:14',NULL,NULL),(817,521,'Accep Histoire',5,'2016-05-15 14:23:40','Un peu court, mais correct. ',NULL),(818,416,'Préinscription - Bélé I 2016',2,'2016-05-15 14:25:44',NULL,NULL),(819,441,'Préinscription - Bélé I 2016',2,'2016-05-15 14:25:49',NULL,NULL),(820,28,'Accep Histoire',5,'2016-05-15 14:26:37','',NULL),(821,519,'Accep Histoire',5,'2016-05-15 14:27:29','',NULL),(822,488,'Préinscription - Bélé I 2016',2,'2016-05-15 14:29:43',NULL,NULL),(823,172,'Transfert',15,'2016-05-15