stoire',5,'2016-05-15 20:36:13','',NULL),(900,561,'Préinscription - Bélé I 2016',2,'2016-05-15 20:38:37',NULL,NULL),(901,554,'Préinscription - Bélé I 2016',2,'2016-05-15 20:38:58',NULL,NULL),(902,336,'Accep Histoire',5,'2016-05-15 20:40:21','',NULL),(903,480,'Préinscription - Bélé I 2016',2,'2016-05-15 20:43:04',NULL,NULL),(904,461,'Accep Histoire',5,'2016-05-15 20:44:13','Pour ajouter au réalisme de ton marin, tu peux raconter qu\'il a raconté beaucoup de Galleonite. Le fleuve Maxence est contrôlé par les forces navales du Royaume du Nord basé à Port-Nouvel-Espérance. Normalement, il ne laisse naviguer personne, mais tu pourrais trouver une histoire pourquoi. Il dirige la Mer du Nord, mais laisse tout le monde naviguer dans cette mer. \n\nhttps://belenos.smugmug.com/Autres/Cartes-de-jeu/Cartes-766 ',NULL),(905,240,'Préinscription - Bélé I 2016',2,'2016-05-15 20:45:14',NULL,NULL),(906,551,'Accep Histoire',5,'2016-05-15 20:46:41','',NULL),(907,310,'Accep Histoire',5,'2016-05-15 20:49:57','Les esprits ne parlent pas réellement aux gens. (Il s\'agit d\'une habileté spéciale). Donc , ton personnage peut percevoir des choses ce qu\'il interprète comme des signes.\n\nComme les prêtres n\'entendent pas leurs dieux, les shaman n\'entendent pas les esprits. Tu peux parler aux morts ou avoir parlé à des morts par contre.\n\nLe reste de l\'histoire est bon. ',NULL),(908,357,'Accep Histoire',5,'2016-05-15 20:50:27','',NULL),(909,157,'Accep Histoire',5,'2016-05-15 20:50:51','',NULL),(910,488,'Accep Histoire',5,'2016-05-15 20:53:24','La forêt noire étant jalousement gardé par les elfes, il est impossible que ton personnage y aille trouver quoi que ce soit de Noctave. Tu pourrais dire simplement en forêt ou dans les bois, sans préciser la forêt. ',NULL),(912,414,'Accep Histoire',5,'2016-05-15 20:56:29','',NULL),(913,316,'Accep Histoire',5,'2016-05-15 20:58:07','',NULL),(914,18,'Accep Histoire',5,'2016-05-15 20:58:24','',NULL),(915,563,'Préinscription - Bélé I 2016',2,'2016-05-15 20:59:15',NULL,NULL),(916,187,'Accep Histoire',5,'2016-05-15 21:00:00','',NULL),(917,550,'Accep Histoire',5,'2016-05-15 21:02:17','',NULL),(918,28,'Achat - Sort - Niveau I',-8,'2016-05-15 21:04:18',NULL,NULL),(919,176,'Accep Histoire',5,'2016-05-15 21:08:46','',NULL),(920,555,'Accep Histoire',5,'2016-05-15 21:09:18','',NULL),(922,441,'Achat - 1er point de vie',-4,'2016-05-15 21:17:06',NULL,NULL),(923,62,'Accep Histoire',5,'2016-05-15 21:17:17','Dame Amélia a indiqué prier Sylva dans son background, elle a auparavant prié Muse et ensuite les Sibylles. Libre à toi de modifier ou non ton BG.\n\nIl a été accepté, très bien écrit. ',NULL),(924,240,'Accep Histoire',5,'2016-05-15 21:18:13','',NULL),(925,326,'Accep Histoire',5,'2016-05-15 21:25:01','Ta vision de golgoth est bonne et ton background est correct, nous allons l\'accepter. Mais modifie impérativement ta provenance.\n\nIl est impossible de provenir du Shatai. Il y a une communauté shataienne à Novanadjev dans le Comté de Markelus et une autre dans le Comté de Longevia (démoniste) et Comté de Jade (demoniste). ',NULL),(926,559,'Accep Histoire',5,'2016-05-15 21:26:43','Sans commentaire',NULL),(927,46,'Achat - 1er point de vie',-5,'2016-05-15 22:03:28',NULL,NULL),(928,388,'Préinscription - Bélé I 2016',2,'2016-05-15 22:27:15',NULL,NULL),(929,564,'Préinscription - Bélé I 2016',2,'2016-05-15 22:48:54',NULL,NULL),(930,555,'Achat - 1er point de vie',-4,'2016-05-16 00:02:49',NULL,NULL),(931,297,'Préinscription - Bélé I 2016',2,'2016-05-16 03:01:42',NULL,NULL),(932,278,'Niveau annulé',47,'2016-05-16 04:24:51',NULL,NULL),(933,400,'Accep Histoire',5,'2016-05-16 05:15:30','',NULL),(934,332,'Accep Histoire',5,'2016-05-16 05:17:03','',NULL),(935,196,'Accep Histoire',5,'2016-05-16 05:17:23','',NULL),(936,526,'Accep Histoire',5,'2016-05-16 05:18:28','',NULL),(937,65,'Accep Histoire',5,'2016-05-16 05:25:00','',NULL),(938,431,'Accep Histoire',5,'2016-05-16 05:25:57','',NULL),(939,565,'Préinscription - Bélé I 2016',2,'2016-05-16 05:38:58',NULL,NULL),(940,84,'Préinscription - Bélé I 2016',2,'2016-05-16 06:39:35',NULL,NULL),(941,562,'Accep Histoire',5,'2016-05-16 06:42:13','Quel royaume? Aurélius? Faut faire attention, de ne pas inventer de nouveaux royaumes. ',NULL),(942,103,'Accep Histoire',5,'2016-05-16 06:45:47','',NULL),(943,112,'Préinscription - Bélé I 2016',2,'2016-05-16 06:55:36',NULL,NULL),(944,422,'Accep Histoire',5,'2016-05-16 07:07:12','Aurélius n\'est pas porté par le commerce hors-la-loi ou le pillage. En fait, Aurélius ne possèdent aucune flotte, ni militaire ni commerciale. Leur seul voie navigable, le fleuve Maxence est contrôlé par les galleonites du Royaume du Nord, qui eux possède la plus grande flotte d\'Illumine (style drakkar), basé en grande partie à Port-Nouvel-Espérance. \n\nCela dit ton bg est très bien! :) ',NULL),(945,563,'Accep Histoire',5,'2016-05-16 07:07:35','',NULL),(946,171,'Accep Histoire',5,'2016-05-16 07:11:41','',NULL),(947,315,'Accep Histoire',5,'2016-05-16 07:12:38',NULL,NULL),(948,435,'Accep Histoire',5,'2016-05-16 07:15:11','',NULL),(949,179,'Accep Histoire',5,'2016-05-16 07:17:50','',NULL),(950,524,'Accep Histoire',5,'2016-05-16 07:18:24','',NULL),(951,344,'Transfert',12,'2016-05-16 07:24:50',NULL,NULL),(952,344,'Achat - Magie cléricale II',-19,'2016-05-16 07:25:28',NULL,NULL),(953,68,'Transfert',54,'2016-05-16 07:33:44',NULL,NULL),(954,68,'Achat - Magie cléricale II',-19,'2016-05-16 07:34:05',NULL,NULL),(955,68,'Achat - Sort - Niveau II',-15,'2016-05-16 07:34:23',NULL,NULL),(956,68,'Achat - Connaissance de la langue arcanique',-20,'2016-05-16 07:34:34',NULL,NULL),(957,68,'Transfert',1,'2016-05-16 07:40:23',NULL,NULL),(958,68,'Achat - Recueillement',-8,'2016-05-16 07:40:40',NULL,NULL),(959,153,'Transfert',12,'2016-05-16 08:32:45',NULL,NULL),(960,153,'Achat - Magie cléricale II',-19,'2016-05-16 08:32:58',NULL,NULL),(961,471,'Préinscription - Bélé I 2016',2,'2016-05-16 09:03:02',NULL,NULL),(962,103,'Transfert',43,'2016-05-16 09:43:09',NULL,NULL),(963,103